Sax seems to be a lot stricter with XSD handling than libXML2. While having a choice of two times the same child element doesn't make any logical sense of course it shouldn't actually be a problem when verifying a document as either choice would lead to the same result.

While the PR by @kubawerlos fixes the duplication, the xs:choice could also be removed as it's superfluous with only one sequence to choose from.

@kubawerlos Do you want to update your PR or do you want me to make create a new one?
